@-moz-document domain("se7ensins.com") {
#navigation .helper {
    display: block;
    height: 25px;
    left: -5px;
    position: absolute;
    top: -16px;
    width: 100%;
    background: none;
    background:none; 
    _background: url(http://www.se7ensins.com/styles/holidayjoy/images/shelley_snow_l.png) no-repeat;
}
.sidebar .section:before {
    content: "";
    display: block;
    height: 0px;
    margin-top: 0px;
    background: none;
}
.node .tlc {
    position: absolute;
    top: 0px;
    left: 0px;
    -webkit-transform: rotate(-15deg);
    -moz-transform: rotate(-15deg);
    -o-transform: rotate(-15deg);
    -ms-transform: rotate(-15deg);
    transform: rotate(-15deg);
    background: none;
    width: 0px;
    height: 0px;
}
.nodeList.sectionMain .categoryText {
   padding-left: 0px;
}
}
